const candidateDetailMain = automaRefData('variables', 'candidateDetailMain');
const recruitmentIdData = automaRefData('variables', 'recruitmentIdData');
const interviewTime = automaRefData('variables', 'interviewTime');
const userId = globalData?.userId || '1831302864665706497'
// 准备流程节点数据
let nodes = JSON.parse(JSON.stringify(recruitmentIdData?.processTemplateVo?.nodes));
nodes.forEach((item) => {
  item.abilityIds = item.abilities.map((ability) => ability.id) || [];
  delete item.abilities;
});

// 遍历节点,如果节点的责任人id没有就默认当前登录用户
nodes.forEach((item) => {
  if (interviewTime && userId) {
    if (item?.assignee?.userId === userId && item?.name !== '选择简历') {
      const time = interviewTime;
      item.interviewTime = time;
    }
  }
  if (!item.assigneeId) {
    item.assigneeId = userId;
  }
});

// 1. 构建面试数据
const interviewData = {
  name:
    (recruitmentIdData?.name || recruitmentIdData?.processTemplateVo?.name) +
    (candidateDetailMain?.name ? '-' + candidateDetailMain?.name : ''),
  description: recruitmentIdData?.processTemplateVo?.description,
  profileName: recruitmentIdData?.processTemplateVo?.positionProfile?.name,
  positionProfileId: recruitmentIdData?.processTemplateVo?.positionProfileId,
  processNodes: nodes,
  candidateId: candidateDetailMain?.id,
