const selector = automaRefData('loopData', 'QWrlI-.data') || null;
let a = selector?.split('|>').map(s => s.trim()) || null;
if (a && a.length > 0) {
  const element_demp = a[1]
  let doc_demo = document
  let f_demo = document.querySelector('.frame-container')
  let c_demo = f_demo.querySelector('.frame-box')
  const iframe = c_demo.getElementsByTagName('iframe')[0]; 
  if (iframe) {
    const iframeDoc = iframe.contentDocument || iframe.contentWindow.document;
    // 注入样式
    const style = iframeDoc.createElement('style');
    style.textContent = `
      @keyframes scanning {
        0% { background-position: -100% 0; }
        100% { background-position: 200% 0; }
      }

      .scanning-effect {
        position: relative;
        overflow: hidden;
      }

      .scanning-effect::after {
        content: '';
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        background: linear-gradient(
          90deg,
          transparent 0%,
          rgba(0, 168, 168, 0.3) 50%,
          transparent 100%
        );
        background-size: 50% 100%;
        background-repeat: no-repeat;
        animation: scanning 1.5s ease-in-out infinite;
        pointer-events: none;
      }
    `;
    iframeDoc.head.appendChild(style);
    let el_demo = iframeDoc.querySelector(element_demp)
    console.log(el_demo,'QWrlI-')
    if (el_demo) {
      el_demo.classList.add('scanning-effect');
    }
  }
}
